<template>
    <div class="storeDetails">
        <my-header title="店铺"></my-header>
        <div class="content">
            <div class="img"></div>
            <div class="foodSort">
                <div class="foot-title">
                    {{ title }}
                    <img :src="img" alt="" class="store-img">
                </div>
                <van-tabs color="#ffc400">
                    <van-tab v-for="(item, index) in storeData" :key="index" :title="item.name">
                        <FoodList :index="index" :foodData="item.data"></FoodList> <!-- 引入每个标签下的组件 -->
                    </van-tab>
                </van-tabs>
            </div>
        </div>
        <van-action-bar>
            <van-action-bar-icon icon="chat-o" text="客服" />
            <van-action-bar-icon icon="cart-o" text="购物车" :badge="store.state.carList.length" @click="goCart" />
            <van-action-bar-button type="warning" text="加入购物车" @click="handleAddCart" />
            <van-action-bar-button type="danger" text="立即购买" @click="goBuy" />
        </van-action-bar>
    </div>
</template>

<script>
import { reactive, toRefs } from 'vue'
import FoodList from './components/FoodList.vue'
import MyHeader from "@/components/MyHeader";
import { useStore } from 'vuex';
import { useRouter } from 'vue-router';
import {Toast} from 'vant'
export default {
    name: "MyStore",
    components: {
        MyHeader, FoodList
    },
    setup() {
        let store = useStore();
        let router = useRouter();
        let data = reactive({
            title: '鱼拿酸菜鱼',
            img: ' https://img1.baidu.com/it/u=1599947592,1695977044&fm=253&fmt=auto&app=138&f=JPEG?w=640&h=440',
            storeData: [
                {
                    name: "点菜",
                    data: {
                        content: "点菜",
                        items: [
                            {
                                text: "热销套餐",
                                children: [
                                    {
                                        pic: "data:image/jpeg;base64,",
                                        title: "隆江猪脚饭",
                                        num: 0,
                                        price: 25.0,
                                        id: 1,
                                        add: true,
                                    },
                                    {
                                        pic: "data:image/jpeg;base64,",
                                        title: "隆江猪脚饭",
                                        num: 0,
                                        price: 25.0,
                                        id: 2,
                                        add: true,
                                    },
                                ],
                            },
                            {
                                text: "超级折扣",
                                children: [
                                    {
                                        pic: "https://img1.baidu.com/it/u=1599947592,1695977044&fm=253&fmt=auto&app=138&f=JPEG?w=640&h=440",
                                        title: "无骨酸菜鱼+肥牛双拼",
                                        num: 0,
                                        price: 25.0,
                                        id: 3,
                                        add: true,
                                    },
                                    {
                                        pic: "https://img1.baidu.com/it/u=1599947592,1695977044&fm=253&fmt=auto&app=138&f=JPEG?w=640&h=440",
                                        title: "香辣水煮鱼+肥牛双拼",
                                        num: 0,
                                        price: 25.0,
                                        id: 4,
                                        add: true,
                                    },
                                ],
                            },
                        ],
                    },
                },
                {
                    name: "评价",
                    data: {
                        content: "评价",
                    },
                },
                {
                    name: "商家",
                    data: {
                        content: "商家",
                    },
                },
            ],
        });
        //点击发送数据
        const handleAddCart = (type) => {
            const newList = store.state.carList || [];
            data.storeData.forEach((item) => {
                item.data.items?.forEach(item => {
                    item.children.forEach(item => {
                        if (item.num > 0) {
                            newList.push(item);
                        }
                    })
                })
            });
            if(newList.length === 0){
                // debugger
                Toast('请选择商品');
                return
            }
            store.commit('ADDCART', newList);
            type === 'buy' ? goCart():"";
        };

        const goCart = () =>{
            router.push('/cart')
        };
        const goBuy = () =>{
            handleAddCart('buy')
        };
        return {
            ...toRefs(data),
            handleAddCart,
            store,
            goCart,
            goBuy
        };
    }
}
</script>

